import React, { useContext, useState } from "react";
import { FaShoppingCart, FaUserCircle } from "react-icons/fa";
import { Link, useLocation } from "react-router-dom";
import styled, { keyframes, css } from "styled-components";
import { ProductContext } from "../../Context/ProductContextProvider";

// Animations
const shake = keyframes`
  0%, 100% { transform: rotate(0deg); }
  20%, 60% { transform: rotate(-15deg); }
  40%, 80% { transform: rotate(15deg); }
`;

const activeItems = keyframes`
  0%, 100% { transform: scale(1.1); }
  20%, 60% { transform: scale(1); color: goldenrod; }
  40%, 80% { transform: scale(1.2); }
`;

const pulse = keyframes`
  0%, 100% { transform: scale(1); }
  50% { transform: scale(1.1); color: #7d2f9ed3; }
`;

// Styled Components
const Container = styled.div`
  max-height: 80px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: calc(100% - 245px);
  padding: 20px;
  border-radius: 16px;
  margin: 20px auto;
  background: rgba(142, 68, 173, 0.02);
  box-shadow: 0 4px 30px rgba(0, 0, 0, 0.1);
  backdrop-filter: blur(0px);
  ${({ isDarkTheme }) =>
    isDarkTheme &&
    css`
      background-color: #1a1a1a;
      color: white;
    `}
`;

const Logo = styled.div`
  color: #8e44ad;
  h1 {
    font-size: 24px;
    font-weight: bold;
  }
`;

const Hamburger = styled.div`
  width: 2rem;
  height: 2rem;
  display: none;
  cursor: pointer;
  position: fixed;
  top: 15px;
  left: 10px;
  z-index: 20;

  div {
    width: 2rem;
    height: 0.25rem;
    background: linear-gradient(135deg, #a68ebd, #8e44ad);
    border-radius: 10px;
    transform-origin: 1px;
    transition: all 0.3s linear;
  }

  ${({ open }) =>
    open &&
    css`
      div:nth-child(1) {
        transform: rotate(45deg);
      }
      div:nth-child(2) {
        transform: translateX(-500%);
        opacity: 0;
      }
      div:nth-child(3) {
        transform: rotate(-45deg);
      }
    `}
`;

const Links = styled.ul`
  list-style: none;
  display: flex;
  gap: 30px;
  padding: 12px 10px;
  ${({ open }) =>
    open &&
    css`
      flex-direction: column;
      position: fixed;
      top: 0;
      right: 0;
      width: 250px;
      height: 100vh;
      transform: translateX(0);
      backdrop-filter: blur(12px);
      background: rgba(166, 142, 189, 0.85);
      box-shadow: 0 8px 16px rgba(0, 0, 0, 0.2);
      padding-top: 80px;
    `}
`;

const LinkItem = styled.li`
  padding: 5px 0;

  a {
    text-decoration: none;
    color: black;
    transition: color 0.3s ease;
    font-size: 18px;
    white-space: nowrap;
    position: relative;

    &::after {
      content: "";
      position: absolute;
      left: 50%;
      bottom: -3px;
      transform: translateX(-50%);
      width: 0;
      height: 2px;
      background-color: #8e44ad;
      transition: width 0.3s ease;
    }

    &:hover {
      color: #8e44ad;

      &::after {
        width: 100%;
      }
    }
  }
`;

const IconContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;

  svg {
    font-size: 30px;
    transition: color 0.3s ease;
    margin: 10px;

    &:hover {
      animation: ${shake} 0.4s ease-in-out;
    }
  }

  .profile {
    color: rgb(121, 79, 158);

    &:hover {
      animation: ${pulse} 0.9s ease-in-out infinite;
    }
  }

  .ItemsSelected {
    animation: ${activeItems} infinite 1s ease-in-out;
  }
`;

const Nav = () => {
  const [open, setOpen] = useState(false);
  const { state } = useContext(ProductContext);
  const location = useLocation();
  const isDarkTheme = location.pathname === "/login" || location.pathname === "/register";

  return (
    <Container isDarkTheme={isDarkTheme}>
      <Hamburger open={open} onClick={() => setOpen(!open)}>
        <div></div>
        <div></div>
        <div></div>
      </Hamburger>
      <Logo>
        <h1>ویولا</h1>
      </Logo>
      <Links open={open}>
        <LinkItem>
          <Link to="/store">محصولات</Link>
        </LinkItem>
        <LinkItem>
          <Link to="/contact">تماس با ما</Link>
        </LinkItem>
        <LinkItem>
          <Link to="/about">درباره ما</Link>
        </LinkItem>
        <LinkItem>
          <Link to="/">صفحه اصلی</Link>
        </LinkItem>
      </Links>
      <IconContainer>
        <Link to="/dashboard">
          <FaUserCircle className="profile" />
        </Link>
        <Link to="/cart">
          <FaShoppingCart
            className={state.selectedItems.length > 0 ? "ItemsSelected" : ""}
          />
        </Link>
      </IconContainer>
    </Container>
  );
};

export default Nav;
